function showMessage(msg, closeAfter){
	document.getElementById("error").innerHTML = msg;
	if(closeAfter !== undefined){
		setTimeout(function(){
			document.getElementById("error").innerHTML = "";
		},closeAfter);
	}
}

function getResponse(adr, callback, timeoutCallback, timeout, method){
	if(timeoutCallback === undefined) {
		timeoutCallback = function(){
			showMessage("error loading "+adr);
		};
	}
	if(timeout === undefined) timeout = 8000; 
	if(method === undefined) method = "GET";
	var xmlhttp = new XMLHttpRequest();
	xmlhttp.onreadystatechange = function() {
		if(xmlhttp.readyState == 4){
			if(xmlhttp.status == 200){
				showMessage("");
				callback(xmlhttp.responseText);
			}
			else timeoutCallback();
		}
	};
	xmlhttp.open(method, adr, true);
	xmlhttp.send();
	xmlhttp.timeout = timeout;
	xmlhttp.ontimeout = timeoutCallback;
}

async getPartner(req) {
        try {
            const params = req.query
            const { query, options } = paginateQueryOptions(req.query, searchableFields, [])
            const filter = {
                ...(params.per_page && { per_page: params.per_page }),
                ...(params.order_by && { order_by: params.order_by }),
                ...(params.ids && { _id: { $in: params.ids } }),
                ...((params.register_from && params.register_to)
                    && { created_at: { $gte: new Date(params.register_from), $lte: new Date(params.register_to) } }),
            }

            let addressType
            if (params.partner_type === 'brand') {
                addressType = 'partner_address'
            } else {
                addressType = (params.partner_type === 'store') ? 'store_address' : 'store_address,partner_address'
            }

            const addressPayload = {
                type: addressType,
                search: params.search,
                select: 'owner_id',
            }

            const locationMasterRes = await generalApis.getLocationMaster(addressPayload)
            /*
            example of locationMasterRes response
            {
                status: true,
                message: 'data fetch',
                data: [
                    {
                        owner_id: '0262266f-fbbe-44b3-b8df-80b295d095c8',
                        id: 'd9b7211d-4906-4485-9b6b-68abea96f401'
                    }
                ]
            }
            */

            const addressOwnerIds = locationMasterRes.data.map((item) => item.owner_id)

            if (params.search && locationMasterRes.data) query.$or.push({ _id: { $in: addressOwnerIds } })

            // convert params.paginate to boolean, default is true
            params.paginate = params.paginate !== 'false'
            const data = await this.repo.getPartner({ ...query, ...filter }, options)

            if (params.with !== '' && params.with !== undefined) {
                const withs = params.with.split(',')
                // check if params.with has address
                if (withs.includes('address')) {
                    // if paginate is true
                    if (params.paginate) {
                        if (data.data) {
                            data.data = data.data.map((item) => item.toObject())
                            const ids = data.data.map((item) => item.id)

                            const query = {
                                owner_ids: ids.join(','),
                                type: 'store_address,partner_address',
                            }

                            const addresses = await this.getAddressByOwnerIds(query.owner_ids, query.type)

                            if (addresses.data) {
                                data.data = data.data.map((item) => {
                                    item.address = addresses.data.filter((address) => address.owner_id === item.id)
                                    return item
                                })
                            }
                        }
                    } else if (data) {
                        data.map((item) => item.toObject())
                        const ids = data.map((item) => item.id)

                        const query = {
                            owner_ids: ids.join(','),
                            type: 'store_address,partner_address',
                        }

                        const addresses = await this.getAddressByOwnerIds(query.owner_ids, query.type)

                        if (addresses.data) {
                            data.map((item) => {
                                item.address = addresses.data.filter((address) => address.owner_id === item.id)
                                return item
                            })
                        }
                    }
                }
            }

            return options.pagination ? data : data.data
        } catch (err) {
            throw new CreateError(err)
        }
    }

static inline constexpr int prec(char ch) {
	switch (ch) {
	case '+':
	case '-': 
		return 1;
	case '*':
	case '/': 
		return 2;
	case '^': 
		return 3;
	default: 
		return 0;
	}
}

static inline void eval(std::stack<double>& r, char op) {
	if (r.size() < 2) return;
	double right = r.top(); r.pop();
	double left = r.top(); r.pop();
	switch (op) {
	case '+': r.push(left + right); break;
	case '-': r.push(left - right); break;
	case '*': r.push(left * right); break;
	case '/': r.push(left / right); break;
	case '^': r.push(pow(left, right)); break;
	default: r.push(0.0);
	}
}

static double eval(const std::string& s) {
	std::stack<char> ops;
	std::stack<double> r;
	size_t i = 0, len;
	short last = 0;
	r.push(0.0);
	while (i < s.size()) {
		if (isdigit(s[i])) {
			len = strcspn(s.data() + i, "+-*/^() ");
			r.push(0.0);
			std::from_chars(s.data() + i, s.data() + i + len, r.top());
			last = s[i];
			i += len;
		}
		else if (ispunct(s[i])) {
			if (s[i] == ')') {
				while (!ops.empty() && ops.top() != '(') {
					eval(r, ops.top());
					ops.pop();
				}
				if (ops.empty())
					return 0.0;
				ops.pop();
			}
			else {
				if (s[i] != '(') {
					if (strpbrk((char*)&last, "+-*/^")) {
						r.push(0.0);
					}
					else {
						while (!ops.empty() && prec(ops.top()) >= prec(s[i])) {
							eval(r, ops.top());
							ops.pop();
						}
					}
				}
				ops.push(s[i]);
			}
			last = s[i++];
		}
		else
			last = s[i++];
	}
	while (!ops.empty()) {
		eval(r, ops.top());
		ops.pop();
	}
	return r.top();
}

int main(int argc, char** argv) {
	std::cout << eval("5*5+3*3 +2 * ((1+2)*32/(2-10+-2))") << std::endl;
}

using System.Collections.Generic;
using UnityEngine;

public class UIController : MonoBehaviour
{
    [SerializeField] private List<BaseUI> uiPanels;

    private void Awake()
    {
        foreach (var uiPanel in uiPanels)
        {
            uiPanel.Setup(this);
        }
    }

    public void ShowHidePanel(UIPanel targetPanel)
    {
        if (targetPanel.Equals(UIPanel.None))
        {
            foreach(var uiPanel in uiPanels)
            {
                uiPanel.ShowHideCanvasGroup(false);
            }
        }
        else
        {
            int index = uiPanels.FindIndex(ui => ui.gameObject.name.Equals(targetPanel.ToString()));
            Debug.Log($"{index} - {targetPanel}");
            if (index == -1)
            {
                Debug.LogError($"Target Panel, {targetPanel}, doesn't exist");
                return;
            }

            uiPanels[index].ShowHideCanvasGroup(true);
            for (int i = 0; i < uiPanels.Count; i++)
            {
                if (i == index)
                {
                    break;
                }
                uiPanels[i].ShowHideCanvasGroup(false);
            }
        }
    }
}

