private static bool ContainsPunctuationFollowedByNewLine(string text)
{
    string[] punctuations = new[] { ".", ".</i>", "!", "!</i>", "?", "?</i>" };

    return punctuations.Any(punct => oldText.Contains(punct + Environment.NewLine));
